<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8" />
    <title>Webpack App</title>

    

    <meta name="viewport" content="width=device-width, initial-scale=1" />

     <style>
  html, body {
    overflow: hidden;
    height: 100%;
    width: 100%;
    margin: 0;
    padding: 0;
  }

  * {
    box-sizing: border-box;
  }
</style>

<script>
  /* globals window */
  /* eslint-disable no-underscore-dangle */
  try {
    if (window.top !== window) {
      window.__REACT_DEVTOOLS_GLOBAL_HOOK__ = window.top.__REACT_DEVTOOLS_GLOBAL_HOOK__;
    }
  } catch (e) {
    // eslint-disable-next-line no-console
    console.warn('unable to connect to top frame for connecting dev tools');
  }

  window.onerror = function onerror(message, source, line, column, err) {
    if (window.CONFIG_TYPE !== 'DEVELOPMENT') return;
    // eslint-disable-next-line no-var, vars-on-top
    var xhr = new window.XMLHttpRequest();
    xhr.open('POST', '/runtime-error');
    xhr.setRequestHeader('Content-Type', 'application/json;charset=UTF-8');
    xhr.send(
      JSON.stringify({
        /* eslint-disable object-shorthand */
        message: message,
        source: source,
        line: line,
        column: column,
        error: err && { message: err.message, name: err.name, stack: err.stack },
        origin: 'manager',
        /* eslint-enable object-shorthand */
      })
    );
  };
</script>
<style>
  .sidebar-container {
    background-color: #141413;
  }

  .sidebar-svg-icon,
  .sidebar-item svg {
    color: inherit;
  }
</style>
  

    <style>
      #root[hidden],
      #docs-root[hidden] {
        display: none !important;
      }
    </style>
  </head>
  <body>
    

    <div id="root"></div>
    <div id="docs-root"></div>

    
    <script>
      
          
            window['CONFIG_TYPE'] = "DEVELOPMENT";
          
      
          
            window['LOGLEVEL'] = "info";
          
      
          
            window['FEATURES'] = {"postcss":true,"emotionAlias":false,"warnOnLegacyHierarchySeparator":true,"buildStoriesJson":false,"storyStoreV7":false,"modernInlineRender":false,"breakingChangesV7":false,"interactionsDebugger":false,"babelModeV7":false,"argTypeTargetsV7":false,"previewMdx2":false};
          
      
          
            window['VERSIONCHECK'] = "{\"success\":true,\"data\":{\"latest\":{\"version\":\"6.5.15\",\"info\":{\"plain\":\"#### Bug Fixes\\n\\n-   Support Angular 15.0.4 [#20287](https://github.com/storybooks/storybook/pull/20287)\\n-   CLI: execute automigrations when pressing enter in the prompts [#20208](https://github.com/storybooks/storybook/pull/20208)\\n\\n#### Maintenance\\n\\n-   Ember: Remove global Ember usage [#17843](https://github.com/storybooks/storybook/pull/17843)\"}},\"next\":{\"version\":\"7.0.0-beta.21\",\"info\":{\"plain\":\"#### Maintenance\\n\\n-   Ember: Build with tsc [#20524](https://github.com/storybooks/storybook/pull/20524)\\n-   Storyshots: Build with tsc [#20523](https://github.com/storybooks/storybook/pull/20523)\\n\\n#### Dependencies\\n\\n-   Downgrade find-cache-dir [#20532](https://github.com/storybooks/storybook/pull/20532)\\n\\n#### Build\\n\\n-   Build: Cleanup babel prepare related code & dependencies [#20156](https://github.com/storybooks/storybook/pull/20156)\\n-   Build: Create a tsc prepare script, use it for angular framework, add ESM to angular dist [#20516](https://github.com/storybooks/storybook/pull/20516)\\n-   Build: Fix InternalCanvas story tests [#20521](https://github.com/storybooks/storybook/pull/20521)\"}}},\"time\":1673261017022}";
          
      
          
            window['RELEASE_NOTES_DATA'] = "{\"success\":true,\"showOnFirstLaunch\":false,\"currentVersion\":\"6.5.0\"}";
          
      
          
            window['DOCS_MODE'] = false;
          
      
          
      
          
            window['SERVER_CHANNEL_URL'] = "ws://localhost:6006/storybook-server-channel";
          
      
    </script>
     
    <script src="runtime~main.manager.bundle.js"></script>
    
    <script src="vendors~main.manager.bundle.js"></script>
    
    <script src="main.manager.bundle.js"></script>
    
  </body>
</html>
